import React from "react";
import "./css/style.css";
const Tempapp = () => { 
    return(
        <>
            <div classname="box">
                <div className="inputData">
                    <input type="search" className="inputField"
                        onChange={(event) => {

                        }} />

                </div>
                <div className="info">
                    <h2 className="locations">
                        <i class="fa-regular fa-street-view"></i>Pune
                    </h2>
                    <h1 className="temp">35 C</h1>
                    <h3>Max and Min</h3>
                </div>
            </div> 
        </>
    )
}

export default Tempapp;
